import React, {Component} from 'react'
import * as am4core from "@amcharts/amcharts4/core";
import * as am4maps from "@amcharts/amcharts4/maps";
import am4themes_animated from "@amcharts/amcharts4/themes/animated"; 
import Modals from '../components/modalSignup'
import '../App.css'

import { Button, Col, Row, Container, Form } from 'react-bootstrap'
am4core.useTheme(am4themes_animated);

// const Register = () => {
    class Maps extends Component {

          // Create map instance
          vcomponentDidMount() {
            let chart = am4core.create("chartdiv", am4charts.XYChart);

            chart.paddingRight = 20;

            let data = [];
            let visits = 10;
            for (let i = 1; i < 366; i++) {
              visits += Math.round((Math.random() < 0.5 ? 1 : -1) * Math.random() * 10);
              data.push({ date: new Date(2018, 0, i), name: "name" + i, value: visits });
            }

            chart.data = data;

            let dateAxis = chart.xAxes.push(new am4charts.DateAxis());
            dateAxis.renderer.grid.template.location = 0;

            let valueAxis = chart.yAxes.push(new am4charts.ValueAxis());
            valueAxis.tooltip.disabled = true;
            valueAxis.renderer.minWidth = 35;

            let series = chart.series.push(new am4charts.LineSeries());
            series.dataFields.dateX = "date";
            series.dataFields.valueY = "value";

            series.tooltipText = "{valueY.value}";
            chart.cursor = new am4charts.XYCursor();

            let scrollbarX = new am4charts.XYChartScrollbar();
            scrollbarX.series.push(series);
            chart.scrollbarX = scrollbarX;

            this.chart = chart;


          let button = chart.chartContainer.createChild(am4core.Button);
            button.padding(5, 5, 5, 5);
            button.align = "right";
            button.marginRight = 15;
            button.events.on("hit", function() {
            chart.goHome();
            });
            button.icon = new am4core.Sprite();
            button.icon.path = "M16,8 L14,8 L14,16 L10,16 L10,10 L6,10 L6,16 L2,16 L2,8 L0,8 L8,0 L16,8 Z M16,8";

        }

        componentWillUnmount() {
          if (this.chart) {
            this.chart.dispose();
          }
        }

          state = {
            isOpen: false
          };

          openModal = () => this.setState({ isOpen: true });
          closeModal = () => this.setState({ isOpen: false });

        render() {
        // const [modalShow, setModalShow] = useState(false);

          return (
        <div>
            <div id="chartdiv" style={{ width: "100%", height: "750px" }}>

            {/* <div id="chartdiv" style={{ width: "100%", height: "750px" }} onClick={this.handleClick}> */}
            {/* {this.state.isToggleOn ? 'ON' : 'OFF'} */}

            </div>
            <Modals show={this.state.isOpen} onHide={this.closeModal} />

        </div>
    )
}}

export default Maps
